import chatIcon from "../img/chat-app-icon.png";

const SignInForm = () => {
  return (
    <div className="center br4 ba b--black-10 mv4 mw6 shadow-5">
    <div className="pa4 black-80">
      <Form className="text-center">

        <img src={chatIcon} className="chatIcon" alt="chat-icon"></img>
        <h3 className="f1 fw6 ph0 mh0">Sign in to Chat</h3>
        <input type="email" placeholder="Username" className="pa3 ba bg-transparent w-100" />
        <input type="email" placeholder="Password" className="pa3 ba bg-transparent w-100" />
      </Form>
    </div>
    </div>
  );
};

export default SignInForm;
